import React from 'react';

const DynamicTHead = ({ fields, className = "" }) => {
  return (
    <thead className={className}>
      <tr>
        {/* Mapea los nombres de los campos para crear las cabeceras */}
        {fields.map((field) => (
          <th key={field}>{field}</th>
        ))}
      </tr>
    </thead>
  );
};

export default DynamicTHead;
